// HomePage.js
import React from 'react';

const HomePage = () => (
  <div>
    <h1>Welcome</h1>
    <div>
      <p>Click the button below to navigate to the Consent Page:</p>
      <button onClick={() => { window.location.href = "/consent"; }}>
        Go to Consent Page
      </button>
    </div>
  </div>
);

export default HomePage;
